import axios from "axios";
import React, { useEffect, useState } from "react";
import { baseUrl } from "../baseUrl/baseUrl";
import CatalogItem from "../Components/CatalogItem";
import "./Catalog.css";
import Loading from "../Components/Loading/Loading";

//Канцтовары , хозтовары , мебель , парфюмерия , бытовые техники , компьютеры, телефоны , мода, автоаксессуары , спорттовары

const Catalog = () => {
  const [categories, setCategories] = useState([]);

  useEffect(() => {
    axios
      .get(baseUrl + "/products")
      .then((res) => {
        const dataCategory = res.data.map((datum) => datum.category);

        const filteredCat = new Set(Array.from(dataCategory));

        return filteredCat;
      })
      .then((data) => {
        setCategories(data);
      });
  }, []);

  console.log(categories);

  return (
    <div className="container mb-3">
      <h1>Каталог</h1>
      <div className="catalog">{JSON.stringify(categories)}</div>
    </div>
  );
};

export default Catalog;
